        public static int LengthOfLongestSubstring(string s)
        {
            if (s == "")
            {
                return 0;
            }
            int MaxLen = 1;
            for (int i = 0; i < s.Length - 1; i++)
            {
                string TempString = s[i].ToString();
                for (int j = i + 1; j < s.Length; j++)
                {
                    if (TempString.Contains(s[j]))
                    {
                        break;
                    }
                    else
                    {
                        TempString += s[j].ToString();
                    }
                    //Console.WriteLine(TempString);
                }
                int tempLen = TempString.Length;
                if (MaxLen < tempLen)
                {
                    MaxLen = tempLen;
                }
            }
            return MaxLen;
        }
        public static int LengthOfLongestSubstring_1(string s)
        {
            int MaxLen = 0, i, j;
            if (s == "")
            {
                return MaxLen;
            }

            Dictionary<char, int> dict = new Dictionary<char, int>();
            for (i = 0, j = 0; i < s.Length; i++)
            {
                if (dict.ContainsKey(s.ElementAt(i)))
                {
                    int value;
                    dict.TryGetValue(s.ElementAt(i), out value);
                    j = Math.Max(j, value + 1);
                    dict.Remove(s.ElementAt(i));
                }
                dict.Add(s.ElementAt(i), i);
                MaxLen = Math.Max(MaxLen, i - j + 1);
            }
            return MaxLen;

        }
