        public static int[] TwoSum(int[] nums, int target)
        {
            int[] temp = new int[2];
            for (int i = 0; i < nums.Length - 1; i++)
            {
                int a = nums[i];
                int b = target - a;
                for (int j = i + 1; j < nums.Length; j++)
                {
                    if (nums[j] == b)
                    {
                        temp[0] = i;
                        temp[1] = j;
                        return temp;
                    }
                }
            }
            return null;
        }
        public static int[] TwoSum1(int[] nums, int target)
        {
            int[] temp = new int[2];
            ArrayList array = new ArrayList(nums);
            for (int i = 0; i < nums.Length; i++)
            {
                int b = target - nums[i];
                int j = array.IndexOf(b);
                if (nums.Contains<int>(b) && j != i)
                {
                    temp[0] = i;
                    temp[1] = j;
                    return temp;
                }
            }
            return null;
        }
